import styled from "styled-components";

const MenuContainer = styled.div`
  height: 100vh;
  width: 100vw;
  .fixed;
  .top-0;
  .left-0;
  background: rgba(0, 0, 0, 0.3);
`;

const MenuItems = styled.div`
  .bg-pwhite;
  width: 90vw;
  height: 100vh;
  overflow-y: scroll;
  .fixed;
  left: 10vw;
  .text-pdark;
  .flex;
  .flex-col;
  .justify-between;
  .items-center;
`;

const Menu = styled.div``;

const SideMenu = () => {
  return (
    <MenuContainer>
      <MenuItems>
        <Menu>About</Menu>
        <Menu>Talks</Menu>
        <Menu>Blogs</Menu>
        <Menu>Videos</Menu>
        <Menu>Projects</Menu>
        <Menu>Get in Touch</Menu>
      </MenuItems>
    </MenuContainer>
  );
};

export default SideMenu;
